//Access Xml Request 

import com.eviware.soapui.support.XmlHolder
import com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext

def xmlReq=testRunner.testCase.testSteps['Add'].getPropertyValue('Request');

log.info xmlReq;

//Groovy araciligiyla Req de gonderilen a b degerleri ekleme

//Burada Add e gitmistik
//Altta ise belirtilen xmlReq e girmek icin XmlHolder dan bir obje olustururuz
def sampleXmlReq=new XmlHolder(xmlReq);

log.info sampleXmlReq;

//Add deki Requestte a ya ulasmak icin sirali taglari yazariz
//Req de ki a b degerini manuael deger de atanabilir
//Asagidaki gibi test runner ile cesitli levellerde veride eklenebilir

def caseA=testRunner.testCase.getPropertyValue('a');
def caseB=testRunner.testCase.getPropertyValue('b');

log.info caseA;
log.info caseB;

sampleXmlReq.setNodeValue('//tem:Add/tem:intA',caseA);
sampleXmlReq.setNodeValue('//tem:Add/tem:intB',caseB);

def FinalXml=sampleXmlReq.getXml();

//log.info FinalXml;

testRunner.testCase.testSteps["Add"].setPropertyValue("Request",FinalXml);

def addReqTest=testRunner.testCase.testSteps["Add"];
def contextAddReqTest=new WsdlTestRunContext(addReqTest);

addReqTest.run(testRunner,contextAddReqTest);

//Ders 11
//Response i verify yapmak icin
//Response i oncelikle kaydederiz

def addXMLResponse=testRunner.testCase.testSteps['Add'].getPropertyValue("Response");

def addXmlResponseFinal=new XmlHolder(addXMLResponse);

//Simdi ulasmak istedigimiz veriye gideriz
//Add methodundaki result a ulasmak istiyorduk , bu sebeple get in icine onun yolunu yazariz
//case den zaten a 4 b 4 u almistik , sonucunda 8 oldugunu gorebiliriz


def ResponseValue=addXmlResponseFinal.getNodeValue('//*:AddResult');

log.info ResponseValue;

//Verfy
//Oncelikle a ve b yi integer a cevirmemiz gerekir
//Yukarida a ve b yi case seviyesinde def a ve def b olarak tanimlamistik


int aa=caseA.toInteger();
int bb=caseB.toInteger();

int totalAB=aa+bb;

log.info("total : "+totalAB);

//Elimizde ResponseValue vardi onu da int e cevirmemiz gerekir

int responseFinalValue=ResponseValue.toInteger();

//Simdi tam olarak assert edebiliriz

assert responseFinalValue==totalAB;

boolean xxx=(responseFinalValue==totalAB);


log.info responseFinalValue==totalAB;

//Benzer sekilde if else ile sonucu gosterebiliriz

if(xxx){
	log.info "Pass";
}
else{
	log.info "Failed";
}

